import React, { useState } from 'react';
import { useNavigate, Link } from 'react-router-dom';
import { useAuth } from '../contexts/AuthContext';
import { FaUser, FaLock, FaEye, FaEyeSlash, FaArrowLeft } from 'react-icons/fa';
import './LoginPages.css';

const FacultyLogin = () => {
  const [formData, setFormData] = useState({
    username: '',
    password: ''
  });
  const [showPassword, setShowPassword] = useState(false);
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState('');
  
  const navigate = useNavigate();
  const { login } = useAuth();

  const handleChange = (e) => {
    setFormData({
      ...formData,
      [e.target.name]: e.target.value
    });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    setLoading(true);
    setError('');

    try {
      // Simulate API call - replace with actual backend integration
      if (formData.username === 'faculty' && formData.password === 'faculty123') {
        const facultyUser = {
          id: 1,
          username: formData.username,
          name: 'Dr. Jane Smith',
          department: 'CSE',
          designation: 'Assistant Professor',
          role: 'faculty'
        };
        
        login(facultyUser, 'faculty');
        navigate('/faculty-dashboard');
      } else {
        setError('Invalid username or password');
      }
    } catch (err) {
      setError('Login failed. Please try again.');
    } finally {
      setLoading(false);
    }
  };

  return (
    <div className="login-page faculty-login">
      <div className="login-container">
        <div className="login-card">
          <div className="login-header">
            <Link to="/" className="back-btn">
              <FaArrowLeft />
              <span>Back to Home</span>
            </Link>
            <div className="logo-section">
              <div className="logo">
                <span>TAT</span>
              </div>
              <div className="title">
                <h1>Faculty's Login</h1>
                <p>Trident Academy of Technology</p>
              </div>
            </div>
          </div>

          <form onSubmit={handleSubmit} className="login-form">
            {error && (
              <div className="error-message">
                {error}
              </div>
            )}

            <div className="form-group">
              <label htmlFor="username">
                <FaUser />
                Username
              </label>
              <input
                type="text"
                id="username"
                name="username"
                value={formData.username}
                onChange={handleChange}
                placeholder="Enter your username"
                required
              />
            </div>

            <div className="form-group">
              <label htmlFor="password">
                <FaLock />
                Password
              </label>
              <div className="password-input">
                <input
                  type={showPassword ? 'text' : 'password'}
                  id="password"
                  name="password"
                  value={formData.password}
                  onChange={handleChange}
                  placeholder="Enter your password"
                  required
                />
                <button
                  type="button"
                  className="password-toggle"
                  onClick={() => setShowPassword(!showPassword)}
                >
                  {showPassword ? <FaEyeSlash /> : <FaEye />}
                </button>
              </div>
            </div>

            <button
              type="submit"
              className="login-btn"
              disabled={loading}
            >
              {loading ? 'Signing In...' : 'Sign In'}
            </button>

            <div className="forgot-password">
              <Link to="/forgot-password">Forgot Password?</Link>
            </div>
          </form>

          <div className="login-footer">
            <p>Need help? Contact IT Support</p>
            <p>Default credentials: faculty / faculty123</p>
          </div>
        </div>
      </div>
    </div>
  );
};

export default FacultyLogin;
